content:
Giao hàng rất bậy bạ, không đúng thời gian cam kết.
Đơn hàng mua được hẹn giao trước 12h.
11h51 shiper gọi điện báo 15 phút nữa giao;
11h57 nhận được *** báo đánh giá món hàng đã mua dù chưa nhận được hàng;
Sau đó 12h15 phải sau 5 cú điện thoại giục vì đang vội đi có việc mới nhận được hàng lúc 12h29.
Kèm log *** và điện thoại để minh chứng.

- Điểm +:
• Mẫu mã đẹp; 
• Độ phân giải cao, di chuyển mượt, độ nhạy chuột cao;
- Điểm -:
• Kích thước chuột khá nhỏ gây cảm giác không chắc tay, gây mỏi tay nếu sử dụng thường xuyên

- Hàng đóng trong hộp giấy có bọc chống sốc cẩn thận, giao nhanh, đúng và đủ số lượng;
- Ốp lưng sản xuất 2023 tại Trung Quốc; 
- Giá mua 31/03/2024: 179.000/Cái.
- Ốp lưng gắn vào điện thoại trông chắc chắn và đẹp; độ bền thực tế cần phải chờ 1 thời gian sử dụng mới biết được, hy vọng ổn.
- Nhân viên giao nhận tiki lịch sự.
